import React from 'react'
import { Header, Icon } from 'semantic-ui-react';
import '../App.css';

const Logo = () => (
  <Header as='h2'>
    <Icon name='archive' />
    <Header.Content class="logo">Employee Database</Header.Content>
  </Header>
)

export default Logo
